import { motion } from "framer-motion";
import { useState } from "react"

function Home() {

    const [ number, setNumber ] = useState(1);

    let onClick = (_) => {
        setNumber(number + 1);
    }

    return (
        <div style={{textAlign: 'center'}}>
            <button onClick={onClick}>
                Actuel : {number}
            </button>

            <br />
            <motion.div
                exit={{x: '+140%'}}
                animate={{x: 0}}
                initial={{x: '-180%'}}
                transition={{duration: 1.5}}
            >
                Ouais bon... j'avais pas d'id√©e...
            </motion.div>
        </div>
    )

}

export default Home;
